import React from "react";
import ReactDOM from "react-dom/client";
import "./index.css";
import App from "./App";
import { CssBaseline } from "@mui/material"; // Apply Material-UI's baseline styles
import "./i18next";
import AuthProvider from "./auth/Auth0Provider"; 
import './components/style.css';


const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <AuthProvider>
      <CssBaseline /> {/* Apply Material-UI's baseline styles */}
      <App />
    </AuthProvider>
  </React.StrictMode>
);
